    false,nt"url": null,nt"notes": "This annual narrative report for Flint
    Hills and Marais Des Cygnes National Wildlife Refuges summarizes refuge activities
    during the 1995 calendar year.  The report begins with a summary of the yearu2019s
    highlights and climatic conditions.   Land acquisition-including fee title and other
    is also covered.  The report includes a planning section which discusses management
    plans, compliance with environmental and cultural resource mandates, research and
    investigations.  Refuge administration is outlined; information about personnel,
    youth programs, other manpower programs, volunteer programs, funding, safety, and
    other items is given.  Habitat management is also covered.  Subjects include wetlands,
    forests, cropland, grassland, haying, fire management, pest control, and water rights.
     The wildlife section of the report discusses endangered and/or threatened species,
    waterfowl, marsh and water birds, shorebirds, gulls, terns and allies species, raptors,
    other migratory birds, game mammals, other resident wildlife, fisheries resources,
    scientific collections.  The public uses of the refuge described in this report
    include general, outdoor student classrooms, interpretive foot trails, interpretive
    exhibits/demonstrations, hunting, fishing, trapping, wildlife observation, other
    wildlife oriented recreation, picnicking, other non-wildlife oriented recreation
    and law enforcement.  The equipment and facilities section of the report provides
    information about new construction, rehabilitation, equipment utilization and replacement,
    communications systems, and computer systems.  Items of interest are provided at
